import React, { useState  , useEffect} from "react";
import classes from "./styles/Projects.module.css";
import './styles/cards.css';
import Target_icon from '../assets/target_icon.png';
const Wheel = () => {
  const [dummy, setDummy]   = useState( ['hiii','Hi', 'bubble3','bubble4' ]) ;
    useEffect(() => {
      setInterval(function(){
        setDummy((prevDummy)=>{
          let temp =[...prevDummy];
          const tempFirst = temp[0];
          temp.shift();
          temp.push(tempFirst);
          console.log(temp);
          return temp;
        })

      }, 8000);
    }, [])

  return (
    <>
    <div className={classes.wheels} id="project"></div>
    <a href="#" className={classes.btn}>Projects</a>
      <div className={classes.cards} id="card1">
        <p id="c_title1">{dummy[0]}</p>
      </div>
      <div className={classes.cards} id="card2" >
      <img src={Target_icon} alt="active card" id="target_icon"></img>
        <p id="c_title2">{dummy[1]}</p>
      </div>
      <div className={classes.cards} id="card3">

        <p id="c_title3">{dummy[2]}</p>
      </div>
      <div className={classes.cards} id="card4">
        <p id="c_title4">{dummy[3]}</p>
      </div>


    </>
  );
};

export default Wheel;
